description:
En ung kille hittar en bakdorr till ett dataspel som han blir mycket intressead
av och spelar med truppforflyttningar och atomanfall. Vad han inte vet ar att 
han tagit sig in i Pentagons ledningscentral och haller pa att starta ett tredje
varldskrig.
